export const yFunc = (x) => Math.sqrt((x ** 2 + 1) * Math.E);

export const createExectAns = (step, from, to) => {
  const xArr = [];
  const yArr = [];
  for (let i = from; i <= to; i += step) {
    xArr.push(Math.round(i * 100) / 100);
    yArr.push(Math.round(yFunc(i) * 100) / 100);
  }
  return [xArr, yArr];
};
